  const { title, link, img, price } = props;

  return (
    <div id="cards">

      <a href={link} rel="noopener noreferrer" target="_blank">
      <Grid columns = {2}>
      <Grid.column>
      <Card color="pink">
          <Image src={img} 
          label={{ as: 'a', corner: 'left', icon: 'heart' }}/>
          <Card.Content>
            <Card.Header class="title">{title}</Card.Header>
